import React, { Component, useState, useEffect } from "react";
import { Button, View, Text } from "react-native";

export default class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoggedIn: this.props.route.params.isLoggedIn,
    };
  }
  componentDidUpdate(prevProps) {
    if (prevProps.isLoggedIn !== this.props.route.params.isLoggedIn) {
      this.setState({ isLoggedIn: this.props.route.params.isLoggedIn });
    }
  }
  render() {
    const isAuthenticated = localStorage.getItem("token");
    if (this.state.isLoggedIn == false) {
      return (
        <View
          style={{ flex: 1, alignItems: "center", justifyContent: "center" }}
        >
          <Text>Welcome!</Text>
          <Button
            title="Go to Fitnessinfo"
            onPress={() => this.props.navigation.navigate("Fitnessinfo")}
          />
          <Button
            title="Go to Fitnessplan"
            onPress={() => this.props.navigation.navigate("Fitnessplan")}
          />
          {
            <Button
              title="Go to Login"
              onPress={() => this.props.navigation.navigate("Login")}
            />
          }
        </View>
      );
    } else {
      return (
        <View
          style={{ flex: 1, alignItems: "center", justifyContent: "center" }}
        >
          <Text>Eingeloggt!</Text>
          <Button
            title="Go to Fitnessinfo"
            onPress={() => this.props.navigation.navigate("FitnessinfoAdmin")}
          />
          <Button
            title="Go to Fitnessplan"
            onPress={() => this.props.navigation.navigate("FitnessplanAdmin")}
          />
          <Button
            title="Logout"
            onPress={() => {
              this.props.route.params.handleLogout();
              this.props.navigation.navigate("Home");
            }}
          />
        </View>
      );
    }
  }
}

